import './contact.scss'
import React, { Component } from 'react'

export default class Contact extends Component {
    render() {
        return (
            <footer className="text-center col-md-12 px-0">
                <Row>
                    <div className="col-md-6">
                        <h1>
                            Let's Connect
                        </h1>
                    </div>
                    <div className="col-md-6">

                    </div>
                </Row>
            </footer>
        )
    }
}
